import React from "react";
import "../stylesheets/Project.css";

export function Project(props) {
  return (
    <div className="projects-container">
      <img
        className="image-project" 
        src={require(`../imgs/project-${props.image}.png`)}
        alt="Foto de Shawn"/>
        <div className="contenedor-texto-project">
          <p className="nombre-project">{props.project} en {props.language}</p>
          <p className="tiempo-project">{props.time} Hora/s - Tiempo estimado</p>
          <p className="descripcion-project">{props.description}</p>
        </div>
    </div>
  );
}
